import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Igrac } from '../models/igrac';
import { Tim } from '../models/tim';
import { environment } from 'src/environments/environment';

@Injectable({
  providedIn: 'root'
})
export class FudbalskitimService {

  constructor(private httpClient:HttpClient) { }

  ngOnInit() : void {
  }

  getSviIgraci(){
    return this.httpClient.get<Igrac[]>(environment.api + "/igrac");
  }

  getTimById(timId: number) {
    return this.httpClient.get<Tim[]>(environment.api + "/igrac").find(tim => tim.id === timId);
  }

  getIgracById(igracId: number) {
    return this.igraci.find(igrac => igrac.id === igracId);
  }


}
